  render() {
    return (
      <Container fluid>
        <Row>
            <Col className="loginsignup-col1">
              <Link className="navbar-brand" href="#home" to="/home">
                  <img className="custom-nav-logo2"
                  src="logohero.png"
                  alt="StatHero Logo"
                  width="105px"
                  height="50px" />
              </Link>
            </Col>
            <Col className="loginsignup-col2">
              <p8>Donâ€™t have an account? Sign up free today</p8>
              <Link to="/stats">
                <Button className="custom-jumbo-button" size="md">
                  Sign Up
                </Button>
              </Link>
              <h14 is="custom">WELCOME BACK</h14>
              <p7 is="custom">Sign in below and continue where you left off...</p7>
            </Col>

        </Row>
      </Container>
    )
  }
}
export default JumboLogin;
